import {IonButtons, IonButton} from '@ionic/react';

interface ContainerProps { }

const Navbar: React.FC<ContainerProps> = () => {
  return (
      <IonButtons slot="end">
          <IonButton>Home</IonButton>
          <IonButton>About</IonButton>
          <IonButton>Programmes</IonButton>
      </IonButtons>
  );
};

export default Navbar;
